The Neighbors 3 (NEW 2013 Sweet Sinners) (Split Scenes)
Release Date: July 6, 2013

CAST
India Summer, James Deen, Maddy O`Reilly, Michael Vegas, Steven St Croix

Neighbors 3: While trying to attract the attention of a cute girl who just moved in next door, a young man sets up his dad with the girl`s mother. When the dad tries to help his son win the girl`s attention, he discovers that the girl`s amorous intentions are with him, an older man, and not his son. But not all is lost when the young man discovers that the older woman has a thing for younger men. Riveting sexual performances from some of the top stars, India Summer, Maddy O`Reilly, Steven St. Croix, Michael Vegas and James Deen.

